import React from "react";
import "../src/css/dep.css";
function Wit() {
  return (
    <div className="dmain">
      <div className="dbody">
        <div className="dh">WITHDRAW</div>
        <br />
        <button className="mdb">20</button>
        <button className="db">50</button>
        <button className="db">100</button>
        <br />
        <button className="mdb">500</button>
        <button className="db">1000</button>
        <button className="db">2000</button>
      </div>
    </div>
  );
}
export default Wit;
